ont-size: 4em;","                text-align: center;","                padding-bottom: -15px;","                width: 180px;","                line-height: 180px;","                margin-right: auto;","                margin-left: auto;","                margin-bottom: 5%;","                text-decoration: underline;","                text-decoration-color: deeppink;","                }","            ","            #introduction_section {","                padding-top: 2%;","                }","            ","            #introduction_paragraph {","                text-indent: 40px;","                }","            ","            #cat_paragraph {","                text-align: center;","                padding-bottom: 4%;","                }","            ","            .assignment_thoughts_sections {","                float: left;","                margin: 2%;","                max-width: 44%;","                }","            ","            #php_links_section {","                clear: both;","                color: red;","                margin: 0;","                margin-bottom: 5%;","                padding-top: 2%;","                padding-bottom: 2%;","                }","            ","            #github_profile_section {","                background-color: royalblue;","                color: white;","                border-radius: 10px 10px 0px 0px;","                text-align: center;","                margin-right: auto;","                margin-left: auto;","                padding: 1% 0 0.05% 0;","                max-width: 15%;","                letter-spacing: 0.04em;","                line-height: 0.4em;","                }","            ","            #github_profile_link {","                text-decoration: none;","                }","            ","            #github_profile_section:hover {","                background-color: black;","                color: hotpink;","                transition-duration: 1s;","                }","         