>","","                    <section class=\"assignment_thoughts_sections\">","                        <h2>Challenges?</h2>","                        <p>Margins and padding doing weird things! Sometimes I'll find that margins or applied to certain sections of the code are creating undesirablely large spaces on areas I didn't want them to. So there's a good chunk of time troubleshooting where the issue is to remove that rogue margin/padding effect. </p>","                    </section>","","                    <section id=\"php_links_section\">","                        <?php","                        <p>This will be the PHP paragraph - In PHP, create another paragraph. Within the paragraph, link to two of your favorite websites and provide a short description. Create a second paragraph and write some a a few sentences reflecting on how challenging this assignment was for you - was it easy? hard? what did you have problems with, if any? . Add two links</p>","                        <h2>1st PHP graphs</h2>","                        <p>This is the paragraph for practicing PHP in! Inside are two links: LINK 1 and LINK 2</p>","                        <p>SECOND PARAGRAPH - this assignment was definitely a refresher for CSS/HTML, found it challenging because I haven't made a webpage since spring. </p>","                        ?>","                    </section>","                </section>","","                    <a id=\"github_profile_link\" href=\"https://github.com/camiviban\" target=\"_blank\">","                        <section id=\"github_profile_section\">","                            <p>Github Profile</p>","                        </section>","                    </a>","            </section>","        </main>","    ","        <footer>","            <p>COSW 30 Fall 2019 - Lab 1 - Ona</p>","        </footer>","    </body>","</html>"]}],[{"start":{"row":152,"column":0},"end":{"row":157,"column":26},"action":"remove","lines":["                        <?php","       